import React from 'react';
import {Heading, Table, TableCaption, Th, Thead, Tr} from "@chakra-ui/react";

const AssignedQuizPage = () => {
    return (
        <>
            <Heading>Assigned quiz page</Heading>
            <Table variant={'striped'} colorScheme={'teal'}>
                <TableCaption>Assigned Quizzes</TableCaption>

                <Thead>
                    <Tr>
                        <Th>No</Th>
                        <Th>Quiz Name</Th>
                        <Th>Date</Th>
                        <Th>Action</Th>
                    </Tr>
                </Thead>

                

            </Table>
        </>
    );
};

export default AssignedQuizPage;
